- input: "TEXT\x1CC00313510\x1CX0\x1C\x1CF3A\x1CThis amendment responds to your letter
    dated 4/18/11. We have determined that Berkeley College did not have permissible
    funds available when it made its 10/21/10 donation and we have returned that donation
    today. I will fax a copy of the check to you. We have verbal confirmation from
    Belleville Firefighters and Nutley Democratic Club that they did have permissible
    funds available to cover their donations on the day they made them. They are returning
    signed letters to us to that effect and I will fax copies to you. We have determined
    that Federal Recovery LLC files its taxes as a partnership and are obtaining written
    confirmation of that. I will fax a copy to you. McManimon & Scotland's excess
    $200 contribution was returned on 12/8/10 and shows up in next report. Stephen
    R. Tilton and Stephen R. Tilton, Jr. are two different people and so their contributions
    are not excessive. The discrepancies between e-c-t-d totals on Lillo, Marco, Ryan
    and the NEA Fund were the result of there having been two records for each of
    them. Their records have now been combined and the totals agree with yours. All
    contributions, donations and sponsorships that were erroneously coded as operating
    expenses are now coded properly as other disbursements. Efforts have been made
    to contact Consulting Engineers PAC of NJ. If we do not resolve that issue by
    close of business today, we will return that contribution and fax you a copy.
    We will also provide a copy of written confirmation that it had permissible funds,
    if that is the case. \n"
